        <header>
        <div style = {style}>
            <h1 class="headline">
                <a> ヘッダー</a>
            </h1>
            <ul class="nav-list">
                <li class="nav-list-item">
                <a>Home</a>
                </li>
                <li class="nav-list-item">About</li>
                <li class="nav-list-item">Topic</li>
            </ul>
        </div>
        </header>
    );
};

export default Header;
